       {
           image: 'https://foo.com/bar.png',
           amount: 0.2,
       },
   ]}
   style={{
       height: '500px',
   }}
>
   <h1>Banner Children</h1>
</ParallaxBanner>
       </ParallaxProvider>
	<div class="section-1">

  </div>
